import{o,c as n,F as i,d as a,a as e}from"./app.7a668d32.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";var t="/images/pos/2/1.webp",s="/images/pos/2/2.webp",l="/images/pos/2/3.webp",d="/images/pos/2/4.webp",h="/images/pos/2/5.webp",p="/images/pos/2/6.webp",u="/images/pos/2/7.webp",v="/images/pos/2/8.webp",k="/images/pos/2/9.webp",m="/images/pos/2/10.webp",c="/images/pos/2/11.webp",z="/images/pos/2/12.webp",b="/images/pos/2/13.webp",y="/images/pos/2/14.webp",g="/images/pos/2/15.webp",j="/images/pos/2/16.webp",_="/images/pos/2/17.webp";const f={},x=a('<h1 id="_2-zakladove-konstrukce" tabindex="-1"><a class="header-anchor" href="#_2-zakladove-konstrukce" aria-hidden="true">#</a> 2. Z\xC1KLADOV\xC9 KONSTRUKCE</h1><p>Z\xE1kladov\xE9 konstrikce p\u0159en\xE1\u0161ej\xED ve\u0161ker\xE9 zat\xED\u017Een\xED z vrchn\xED stavby do podlo\u017E\xED (z\xE1kladov\xE9 sp\xE1ry). Pro navrhnut\xED z\xE1kladov\xE9 konstrukce mus\xEDme zn\xE1t fyzik\xE1ln\u011B mechanick\xE9 vlastnosti p\u016Fdy a jej\xED reakce na zat\xED\u017Een\xED.</p><p>Podle zp\u016Fsobu p\u0159en\xE1\u0161en\xED zat\xED\u017Een\xED ze stavby do z\xE1kladov\xE9 p\u016Fdy d\u011Bl\xEDme na z\xE1klady <strong>plo\u0161n\xE9</strong> a <strong>hlubinn\xE9</strong>.</p><h2 id="plosne-zaklady" tabindex="-1"><a class="header-anchor" href="#plosne-zaklady" aria-hidden="true">#</a> Plo\u0161n\xE9 z\xE1klady</h2><ul><li>jsou neb\u011B\u017Enej\u0161\xED</li><li>maj\xED vodorovnou (horizont\xE1ln\xED) z\xE1kladovou sp\xE1ru</li><li>rozn\xE1\u0161ej\xED zat\xED\u017Een\xED z vrchn\xED stavby na v\u011Bt\u0161\xED plochu tak, aby byly spln\u011Bny po\u017Eadavky I. a II. skupiny mezn\xEDch stav\u016F</li><li>Mezi z\xE1klady plo\u0161n\xE9 pat\u0159\xED <strong>z\xE1kladov\xE9 patky</strong> , <strong>p\xE1sy</strong> , <strong>ro\u0161ty</strong> a <strong>desky</strong>.</li></ul><h3 id="patky" tabindex="-1"><a class="header-anchor" href="#patky" aria-hidden="true">#</a> Patky</h3><ul><li>pou\u017E\xEDvaj\xED se pro skelety</li><li>vy\u017Eaduj\xED m\xE1lo stla\u010Ditelnou p\u016Fd\u016F</li><li>maxim\xE1ln\xED p\u016Fdorysn\xFD rozm\u011Br se doporu\u010Duje 3x3 m</li></ul><h4 id="podle-prurezu-se-patky-deli-na" tabindex="-1"><a class="header-anchor" href="#podle-prurezu-se-patky-deli-na" aria-hidden="true">#</a> Podle pr\u016F\u0159ezu se patky d\u011Bl\xED na:</h4><table><thead><tr><th>Jednostup\u0148ov\xE9</th><th>Dvoustup\u0148ov\xE9</th><th>Tvaru komol\xE9ho jehlanu</th></tr></thead><tbody><tr><td><img src="'+t+'" alt="jednostupnove"></td><td><img src="'+s+'" alt="dvoustupnove"></td><td><img src="'+l+'" alt="tvar-komol-jehlanu"></td></tr></tbody></table><h4 id="podle-technologie-provadeni-se-deli-na" tabindex="-1"><a class="header-anchor" href="#podle-technologie-provadeni-se-deli-na" aria-hidden="true">#</a> Podle technologie prov\xE1d\u011Bn\xED se d\u011Bl\xED na:</h4><h5 id="patky-z-prosteho-betonu" tabindex="-1"><a class="header-anchor" href="#patky-z-prosteho-betonu" aria-hidden="true">#</a> Patky z prost\xE9ho betonu</h5><ul><li>navrhuj\xED se, pokud je dostate\u010Dn\u011B \xFAnosn\xE1 p\u016Fda.</li><li>mohou betonovat p\u0159\xEDmo do z\xE1kladov\xE9 sp\xE1ry</li><li>Velikost p\u016Fdorysn\xE9 strany <strong>max. 2000 mm</strong></li><li>V\xFD\u0161ka m\xE1 b\xFDt rovna cca <strong>1,8 x vylo\u017Een\xED patky</strong>, aby v n\xED nevznikala v\u011Bt\u0161\xED tahov\xE1 nam\xE1h\xE1n\xED.</li><li>Rozn\xE1\u0161ec\xED \xFAhel patek je obvykle <strong>60\xB0</strong>.</li><li>Jednostup\u0148ov\xE9 se zhotovuj\xED do v\xFD\u0161ky kolem 350 mm, ostatn\xED 400mm a v\xEDce.</li></ul><br><img class="centered_image" src="'+d+'"><h5 id="patky-z-monolitickeho-zelezobetonu" tabindex="-1"><a class="header-anchor" href="#patky-z-monolitickeho-zelezobetonu" aria-hidden="true">#</a> Patky z monolitick\xE9ho \u017Eelezobetonu</h5><ul><li>navrhuj\xED se p\u0159i <strong>men\u0161\xED \xFAnosnosti p\u016Fdy</strong>, nebo p\u0159i <strong>vysko\xE9 \xFArovni pozemn\xED vody</strong></li><li>d\xEDky vyztu\u017Een\xED maj\xED <strong>men\u0161\xED v\xFD\u0161ku</strong> \u2192 <strong>men\u0161\xED hloubka</strong> z\xE1kladov\xE9 sp\xE1ry</li><li>mohou b\xFDt \u010Dtvercov\xE9, obd\xE9ln\xEDkov\xE9, lichob\u011B\u017En\xEDkov\xE9 nebo kruhov\xE9</li><li>vy\u017Eaduj\xED podkladn\xED beton (50 - 100mm) a ochranu proti agresivn\xED vod\u011B (n\xE1t\u011Br \u010Di speci\xE1ln\xED beton)</li><li><strong>V\xFD\u0161ka</strong> m\xE1 b\xFDt rovna <strong>cca vylo\u017Een\xED</strong></li><li>Rozn\xE1\u0161ec\xED \xFAhel patek je obvykle <strong>45\xB0</strong> a\u017E <strong>30\xB0</strong>.</li><li>betonuj\xED se do bedn\u011Bn\xED \u2192 roz\u0161\xED\u0159en\xED v\xFDkopu o pracovn\xED prostor</li></ul><br><img class="centered_image" src="'+h+'"><h5 id="patky-prefabrikovane" tabindex="-1"><a class="header-anchor" href="#patky-prefabrikovane" aria-hidden="true">#</a> Patky prefabrikovan\xE9</h5><ul><li>hlavn\u011B u montovan\xFDch skeletov\xE1ch staveb</li><li>nej\u010Dast\u011Bj\u0161\xED tvary - <strong>pln\xE9 a kalichov\xE9</strong></li><li>maj\xED ocelov\xE9 trny, na kter\xE9 se nava\u0159\xED sloupy</li><li>ukl\xE1daj\xED se na \u0161t\u011Brkop\xEDskovou vrstvu, mazaninu, nebo rozn\xE1\u0161ec\xED desku</li><li>Kalichov\xE9 patky maj\xED otvor (kalich), do kter\xE9ho se osad\xED a zabetonuje prefa. sloup</li></ul><br><img class="centered_image" src="'+p+'"><h3 id="pasy" tabindex="-1"><a class="header-anchor" href="#pasy" aria-hidden="true">#</a> P\xE1sy</h3><ul><li>pou\u017E\xEDvaj\xED se tam, kde je <strong>nestejnorod\xE1 z\xE1kladov\xE1 p\u016Fda</strong>, ve kter\xE9 by mohlo doj\xEDt k sed\xE1n\xED budovy, nebo tam kde by <strong>rozm\u011Bry z\xE1kladov\xFDch patek</strong> byly ne\xFAm\u011Brn\u011B velk\xE9 a tud\xED\u017E <strong>neekonomick\xE9</strong>. D\xE1le se pou\u017E\xEDvaj\xED v <strong>poddolovan\xE9m \xFAzem\xED</strong> nebo sesuvn\xFDch oblastech, kde je nutn\xE9 zajistit vodorovnou tuhost z\xE1klad\u016F.</li><li>mohou b\xFDt obd\xE9ln\xEDkov\xE9, nebo lichob\u011B\u017En\xEDkov\xE9 ve tvaru obr\xE1cen\xE9ho p\xEDsmene T</li></ul><br><img class="centered_image" src="'+u+'"><h4 id="podle-materialu-se-deli-na" tabindex="-1"><a class="header-anchor" href="#podle-materialu-se-deli-na" aria-hidden="true">#</a> Podle materi\xE1lu se d\u011Bl\xED na:</h4><h5 id="pasy-z-opracovaneho-lomoveho-kamene" tabindex="-1"><a class="header-anchor" href="#pasy-z-opracovaneho-lomoveho-kamene" aria-hidden="true">#</a> P\xE1sy z opracovan\xE9ho lomov\xE9ho kamene</h5><ul><li>v sou\u010Dasn\xE9 dob\u011B se pou\u017E\xEDvaj\xED pouze u rekonstrukc\xED</li></ul><h5 id="pasy-vyrobeny-z-prosteho-betonu-nebo-betonu-prokladaneho-kamenem" tabindex="-1"><a class="header-anchor" href="#pasy-vyrobeny-z-prosteho-betonu-nebo-betonu-prokladaneho-kamenem" aria-hidden="true">#</a> P\xE1sy vyrobeny z prost\xE9ho betonu nebo betonu prokl\xE1dan\xE9ho kamenem</h5><ul><li>pou\u017E\xEDvaj\xED se p\u0159i men\u0161\xEDm zat\xED\u017Een\xED</li><li>navrhuj\xED se pod zdmi</li><li>p\xE1sy del\u0161\xED ne\u017E 15m se mus\xED rozd\u011Blit dilata\u010Dn\xEDmi sp\xE1rami</li><li>mini\xE1ln\xED rozm\u011Br je 500x500mm</li></ul><h5 id="pasy-z-vyztuzeneho-betonu" tabindex="-1"><a class="header-anchor" href="#pasy-z-vyztuzeneho-betonu" aria-hidden="true">#</a> P\xE1sy z vyztu\u017Een\xE9ho betonu</h5><ul><li>pou\u017E\xEDvaj\xED se p\u0159i v\u011Bt\u0161\xEDm zat\xED\u017Een\xED, nebo pokud je \u0161\xED\u0159ka p\xE1su 3x v\u011Bt\u0161\xED ne\u017E \u0161\xED\u0159ka na n\u011Bm stoj\xEDc\xED zdi</li><li>betonuj\xED se do bedn\u011Bn\xED</li><li>nutno vytvo\u0159it podklad z mazaniny</li></ul><h5 id="prefabrikovane-pasy" tabindex="-1"><a class="header-anchor" href="#prefabrikovane-pasy" aria-hidden="true">#</a> Prefabrikovan\xE9 p\xE1sy</h5><ul><li>mohou b\xFDt PB nebo \u017DB</li><li>mohou tvo\u0159it zdivo suter\xE9nu</li><li>zkracuj\xED dobu v\xFDstavby ale jsou finan\u010Dn\u011B n\xE1ro\u010Dn\xE9</li><li>lze betonovat do ztracen\xE9ho bedn\u011Bn\xED</li><li>komplokovan\u011Bj\u0161\xED ne\u017E prost\xE9 vylit\xED\xE9 betonu</li></ul><br><img class="centered_image" src="'+v+'"><h3 id="rosty" tabindex="-1"><a class="header-anchor" href="#rosty" aria-hidden="true">#</a> Ro\u0161ty</h3><ul><li>vznikaj\xED vz\xE1jemn\xE1m spojen\xEDm p\xE1s\u016F</li><li>v\xFDhodou je tuhost</li><li>pou\u017E\xEDvaj\xED se p\u0159i mal\xE9 \xFAnosnosti zeminy nebo poddolovan\xE9m \xFAzem\xED</li><li>jsou vhodn\xE9 jak pod st\u011Bny tak pod sloupy</li><li>maj\xED stejn\xE9 pr\u016F\u0159ezy jako p\xE1sy</li></ul><br><img class="centered_image" src="'+k+'"><h3 id="desky" tabindex="-1"><a class="header-anchor" href="#desky" aria-hidden="true">#</a> Desky</h3><ul><li>obvykle monolitick\xE9 \u017Eelezobetonov\xE9</li><li>navrhuj\xED se p\u0159i nesourod\xE9 zemin\u011B, p\u0159i vysoko\xE9 \xFArovni pozemn\xED vody (z\xE1kladov\xE1 vana), nebu u v\xFD\u0161kov\xFDch staveb kde by bylo cokoliv jin\xE9ho neekonomick\xE9</li><li>b\xFDvaj\xED velmi n\xE1kladn\xE9</li><li>daj\xED se pou\u017E\xEDt jak pro st\u011Bny tak pro skeletov\xE9 syst\xE9my</li></ul><h4 id="technologie-provadeni" tabindex="-1"><a class="header-anchor" href="#technologie-provadeni" aria-hidden="true">#</a> Technologie prov\xE1d\u011Bn\xED</h4><br>',45),P=e("div",{class:"videoWrapper"},[e("iframe",{width:"560",height:"349",src:"https://www.youtube.com/embed/Hviz46ggQkE",frameborder:"0",allowfullscreen:""})],-1),w=a('<p><em>V sou\u010Dasn\xE9 dob\u011B se p\u0159i v\xFDstavb\u011B z\xE1kladov\xFDch desek u nepodsklepen\xFDch budov st\xE1le v\xEDce pou\u017E\xEDv\xE1 samozhutniteln\xFDch beton\u016F typu Compacton, kter\xE9 umo\u017E\u0148uj\xED realizaci z\xE1kladov\xE9 desky bez vibrov\xE1n\xED a srovn\xE1v\xE1n\xED sm\u011Bsi. Na p\u0159edem p\u0159ipravenou z\xE1kladovou sp\xE1ru, se nejprve provede \u0161t\u011Brkov\xFD podsyp a polo\u017E\xED PE folie. Zhotov\xED se bedn\xEDc\xED konstrukce desky. Na folii se p\u0159iprav\xED navr\u017Een\xE1 ocelov\xE1 v\xFDztu\u017E, v\u011Bt\u0161inou kari s\xED\u0165. V\xFDztu\u017E je um\xEDst\u011Bna na distan\u010Dn\xEDch prvc\xEDch, kter\xE9 zajist\xED jej\xED dostate\u010Dn\xE9 kryt\xED a spolup\u016Fsoben\xED s betonem. V\xFDztu\u017E nesm\xED le\u017Eet p\u0159\xEDmo na folii. Beton\xE1\u017E prob\xEDh\xE1 nalit\xEDm tekut\xE9 betonov\xE9 sm\u011Bsi, kter\xE1 se uvede do roviny pouze lehk\xFDm nat\u0159\xE1s\xE1n\xEDm lat\xED.</em></p><h4 id="podle-tvaru-se-deli-na" tabindex="-1"><a class="header-anchor" href="#podle-tvaru-se-deli-na" aria-hidden="true">#</a> Podle tvaru se d\u011Bl\xED na:</h4><h5 id="rovne" tabindex="-1"><a class="header-anchor" href="#rovne" aria-hidden="true">#</a> Rovn\xE9</h5><ul><li>s konstantn\xED v\xFD\u0161kou 600\u20131200 mm</li><li>vhodn\xE9 hlavn\u011B u st\u011Bnov\xFDch syst\xE9m\u016F</li></ul><h5 id="zebrove" tabindex="-1"><a class="header-anchor" href="#zebrove" aria-hidden="true">#</a> \u017Debrov\xE9</h5><ul><li>p\u0159i v\u011Bt\u0161\xED zat\xED\u017Een\xED a v\u011Bt\u0161\xED osov\xE9 vzd\xE1lenosti svisl\xFDch nosn\xFDch konstrukc\xED, tedy u skeletov\xFDch staveb.</li><li>desky se vyztu\u017Euj\xED \u017Eebry, kter\xE9 l\xE9pe odol\xE1vaj\xED deformac\xEDm</li><li>\u017Eebra mohou b\xFDt nad deskou nebo pod n\xED</li></ul><h5 id="hribove" tabindex="-1"><a class="header-anchor" href="#hribove" aria-hidden="true">#</a> H\u0159ibov\xE9</h5><ul><li>jsou v m\xEDst\u011B sloup\u016F zes\xEDleny h\u0159ibov\xFDmi hlavicemi</li></ul><br><img class="centered_image" src="'+m+'"><h2 id="hlubinne-zaklady" tabindex="-1"><a class="header-anchor" href="#hlubinne-zaklady" aria-hidden="true">#</a> Hlubinn\xE9 z\xE1klady</h2><p>P\u0159i hlubinn\xE9m zakl\xE1d\xE1n\xED se zat\xED\u017Een\xED stavby p\u0159en\xE1\u0161\xED do hlub\u0161\xEDch \xFAnosn\u011Bj\u0161\xEDch vrstev z\xE1kladov\xE9 zeminy pomoc\xED svisl\xFDch nosn\xFDch konstrukc\xED (nap\u0159. pilot, studn\xED, pil\xED\u0159\u016F), na kter\xFDch jsou um\xEDst\u011Bny plo\u0161n\xE9 z\xE1klady, kter\xE9 podporuj\xED.</p><h5 id="pouzivaji-se-kdyz" tabindex="-1"><a class="header-anchor" href="#pouzivaji-se-kdyz" aria-hidden="true">#</a> Pou\u017E\xEDvaj\xED se kdy\u017E:</h5><ul><li>\xFAnosn\xE1 z\xE1kladov\xE1 zemina se nach\xE1z\xED ve v\u011Bt\u0161\xED hloubce</li><li>pou\u017Eit\xED plo\u0161n\xFDch z\xE1klad\u016F je neekonomick\xE9</li><li>z\xE1kladov\xE1 zemina je m\xE1lo \xFAnosn\xE1 a zna\u010Dn\u011B stla\u010Diteln\xE1</li><li>stavba m\xE1 b\xFDt zalo\u017Eena nap\u0159. na velmi vlhk\xE9 nebo na bahnit\xE9 z\xE1kladov\xE9 p\u016Fd\u011B</li></ul><h5 id="podle-zpusobu-prenaseni-zatizeni-se-deli-na" tabindex="-1"><a class="header-anchor" href="#podle-zpusobu-prenaseni-zatizeni-se-deli-na" aria-hidden="true">#</a> Podle zp\u016Fsobu p\u0159en\xE1\u0161en\xED zat\xED\u017Een\xED se d\u011Bl\xED na:</h5><ul><li><strong>vetknut\xE9</strong> \u2013 sloupy nebo pil\xED\u0159e jsou vetknuty do \xFAnosn\xE9 zemin</li><li><strong>plovouc\xED</strong> \u2013 zat\xED\u017Een\xED se p\u0159en\xE1\u0161\xED t\u0159en\xEDm mezi nerovn\xFDm povrchem pilot a zeminou</li></ul><h4 id="mezi-hlubinne-zaklady-patri" tabindex="-1"><a class="header-anchor" href="#mezi-hlubinne-zaklady-patri" aria-hidden="true">#</a> Mezi hlubinn\xE9 z\xE1klady pat\u0159\xED:</h4><table><thead><tr><th>PILOTY</th><th>\u0160ACHOTV\xC9 PIL\xCD\u0158E</th></tr></thead><tbody><tr><td><img class="centered_image" src="'+c+'"></td><td><img class="centered_image" src="'+z+'"></td></tr><tr><td>Z\xC1KLADOV\xC9 STUDNY</td><td>KESONY</td></tr><tr><td><img class="centered_image" src="'+b+'"></td><td><img class="centered_image" src="'+y+'"></td></tr></tbody></table><h2 id="opravy-zakladu" tabindex="-1"><a class="header-anchor" href="#opravy-zakladu" aria-hidden="true">#</a> Opravy z\xE1klad\u016F</h2><p>P\u0159i nestejnom\u011Brn\xE9m sed\xE1n\xED, vlivem r\u016Fzn\xFDch nep\u0159\xEDzniv\xFDch zm\u011Bn v z\xE1kladov\xFDch pom\u011Brech, nebo z\xE1sahy do samotn\xE9 konstrukce \u2013 zv\xFD\u0161en\xED zat\xED\u017Een\xED na z\xE1kladovou zeminu (n\xE1stavba, zv\xFD\u0161en\xED u\u017Eitn\xE9ho zat\xED\u017Een\xED) se mus\xED p\u0159istoupit k \xFAprav\xE1m z\xE1kladov\xE9 konstrukce.</p><h4 id="zpusoby-oprav" tabindex="-1"><a class="header-anchor" href="#zpusoby-oprav" aria-hidden="true">#</a> Zp\u016Fsoby oprav:</h4><h3 id="prohlubovani-zakladu" tabindex="-1"><a class="header-anchor" href="#prohlubovani-zakladu" aria-hidden="true">#</a> Prohlubov\xE1n\xED z\xE1klad\u016F</h3><p>P\u0159i zalo\u017Een\xED do z\xE1mrzn\xE9 hloubky doch\xE1z\xED p\u0159i zmrznut\xED zeminy k nadzvednut\xED z\xE1klad\u016F i svisl\xFDch nosn\xFDch konstrukc\xED a kdy\u017E mrazy pominou, vrac\xED se z\xE1klady i svisl\xE9 konstrukce do p\u016Fvodn\xED polohy. T\xEDm vznikaj\xED v konstrukci trhliny, kter\xE9 se postupem \u010Dasu zv\u011Bt\u0161uj\xED. \u0158e\u0161en\xEDm je prohlouben\xED z\xE1klad\u016F.</p><h5 id="pri-prohlubovani-zakladu-musime" tabindex="-1"><a class="header-anchor" href="#pri-prohlubovani-zakladu-musime" aria-hidden="true">#</a> P\u0159i prohlubov\xE1n\xED z\xE1klad\u016F mus\xEDme:</h5><ul><li>prov\xE9st v\xFDkop po cel\xE9 d\xE9lce objektu na \xFArove\u0148 z\xE1kl. sp\xE1ry</li><li>podezd\xEDvat v z\xE1b\u011Brech dl. 1m, vzd\xE1len\xFDch od sebe 4m</li><li>za\u010D\xEDnat od roh\u016F budovy</li><li>o\u010Distit spodn\xED l\xEDc star\xE9ho z\xE1kladu a ost\u0159\xEDkat vodou</li><li>na urovnan\xE9 dno v\xFDkopu (nejl\xE9pe vybetonovan\xE9) vyzd\xEDvat z ost\u0159e p\xE1len\xFDch cihel/MC s tl. sp\xE1r 5mm</li><li>nov\xE9 zdivo ke star\xE9mu z\xE1kladu d\u016Fkladn\u011B ukl\xEDnovat</li><li>k sousedn\xEDmu z\xE1b\u011Bru se lze vr\xE1tit za 5 \u2013 7 dn\xED</li></ul><br><img class="centered_image" src="'+g+'"><h3 id="rozsirovani-zakladu" tabindex="-1"><a class="header-anchor" href="#rozsirovani-zakladu" aria-hidden="true">#</a> Roz\u0161i\u0159ov\xE1n\xED z\xE1klad\u016F</h3><p>P\u0159\xED\u010Dinou je zv\xFD\u0161en\xED zat\xED\u017Een\xED na z\xE1kladovou sp\xE1ru. O zp\u016Fsobu zvy\u0161ov\xE1n\xED \xFAnosnosti z\xE1klad\u016F rozhodne statik. N\xE1klady na zesilov\xE1n\xED z\xE1kladov\xE9 konstrukce jsou vysok\xE9, proto je t\u0159eba uv\xE1\u017Eit, jestli je p\u0159edpokl\xE1dan\xE1 \xFAprava objektu ekonomicky v\xFDhodn\xE1.\u0158e\u0161en\xEDm je roz\u0161\xED\u0159en\xED z\xE1klad\u016F.</p><h5 id="zpusoby-rozsireni-jsou" tabindex="-1"><a class="header-anchor" href="#zpusoby-rozsireni-jsou" aria-hidden="true">#</a> Zp\u016Fsoby roz\u0161\xED\u0159en\xED jsou:</h5><ul><li>podezd\u011Bn\xEDm a podvle\u010Den\xEDm ocelov\xFDch nosn\xEDk\u016F</li></ul><br><img class="centered_image" src="'+j+'"><ul><li>pomoc\xED \u017Eelezobetonov\xFDch p\u0159\xEDlo\u017Eek</li></ul><br><img class="centered_image" src="'+_+'">',36);function V(N,O){return o(),n(i,null,[x,P,w],64)}var D=r(f,[["render",V]]);export{D as default};
